import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import Iframe from 'react-iframe';

const styles = theme => ({
  root: {
    display: "flex",
    flexWrap: "wrap",
    justifyContent: "space-around",
    overflow: "hidden",
    backgroundColor: theme.palette.background.paper
  },
  gridList: {
    width: 500,
    height: 450
  },
  subheader: {
    width: "100%"
  }
});


function Fields(props) {
  const { classes } = props;

  return (
    <div className={classes.root}>
      <h1>My Fields</h1>


            {/* <iframe src="https://www.google.com/maps/d/embed?mid=1oO7DuCCzGvETVJfD7diWDYBcR86uG8y8" width=100% height="500px"></iframe>
            <Iframe url="https://www.google.com/maps/d/embed?mid=1oO7DuCCzGvETVJfD7diWDYBcR86uG8y8"
            width="1000px"
            height="450px"
            /> */}

    </div>
  );
}

export default withStyles(styles)(ImageGridList);
